import React from 'react'
import {Link } from 'react-router-dom';

const DropdownMenu = () => {
    return (
        <ul className="Navbar">
        <li><Link to="/">Home</Link></li>

        <li><a href="/pageWave">Contacto</a></li>
    </ul>
    )
}

export default DropdownMenu
